script: |
  super -f text -I q3195.spq | sort > q3195.out

inputs:
  - name: q3195.spq
    data: |
      SELECT col1 FROM tab0 (FORMAT parquet) WHERE - col2 + - col2 * col1 * + col1 NOT IN ( - col2 + col1 + tab0.col1 * + tab0.col2 );
  - name: tab0

outputs:
  - name: q3195.out
    data: |
      86
      91
      97
